import { useEffect } from 'react';
function App() {
  useEffect(()=>{
    fetch("https://opentdb.com/api.php?amount=10&category=9&difficulty=hard&type=multiple").then(res => console.log(res.body));
  })
  return (
    <div className="App">

    </div>
  );
}

export default App;
